import axios from 'axios';
// process.env.REACT_APP_BE_URL

const instance = axios.create({
    baseURL: "https://jsonplaceholder.typicode.com/"
})


const login = () => {
    axios.get("todos/1")
.then((res)=>{
    console.log(res)
})
.catch((err)=>{
    console.log(res)
})

}

export {login}
console.log(baseURL)
